import React from 'react';
import GoogleLogin from 'react-google-login';
import '../style/login.scss';

const clientId = "615317878476-8qppdmmuemebo8i0es5uvce8vfgh909a.apps.googleusercontent.com";

const Login = ({ TokenStorage }) => {
  const onSuccess = (response) => TokenStorage.saveToken(response.accessToken);
  const onFailure = (error) => console.log(error);

  return(
    <div className='login'>
      <GoogleLogin
        clientId={clientId}
        responseType={"id_token"}
        onSuccess={onSuccess}
        onFailure={onFailure}
      />
    </div>
  )
}

export default Login;
